def trim(str):
  a = False
  s = ''
  for c in str:
    if c == '1' and not a:
      a = True
    if a:
      s += c
  return s
  
size_og = 40
size_tg = 50

original = ''
s = '0'*(size_og**2-len(original))+original
s = s[::-1]

newGrid = '0'*(size_tg**2)
for (k, val) in enumerate(s):
  i = k % size_og
  j = (k-i)//size_og

  l = size_tg*j+i
  newGrid = newGrid[:l] +val + newGrid[l + 1:]

newGrid = newGrid[::-1]
s = s[::-1]

s = trim(s)
newGrid = trim(newGrid)

print(s)
print(newGrid)
